/* angular-qpme 2017-04-10 */app.filter("date2moment",function($filter){return function(input){var time=moment(input).format("MM/DD/YY - HH:MM");return time}}),app.filter("reverse",function(){return function(input,uppercase){input=input||"";for(var out="",i=0;i<input.length;i++)out=input.charAt(i)+out;return uppercase&&(out=out.toUpperCase()),out}});